# Iterate through the alphabet and get a list of urls to parse
player_urls: list[str] = []
for letter in string.ascii_uppercase:
    player_page_url = f"https://www.pro-football-reference.com/players/{letter}/"
    
    # Convert html to soup
    player_page_html = getHtmlFromUrl(player_page_url)
    player_page_soup = BeautifulSoup(player_page_html, features="html.parser")
    
    #Get the player list div
    player_list_div = player_page_soup.find("div", id="div_players")
    
    #Filter by active year
    p_list = player_list_div.find_all("p")
    for p in p_list:
        #Filter by active year
        text = p.text.strip()

        if str(active_year) in text and ("QB" in text or "RB" in text or "WR" in text or "TE" in text):

            print(p.text.strip())
            
            #Get url - call it, and save it
            a = p.find("a")
            if a and a.get("href", "").startswith("/players/"):
                player_url = base_url + a['href']
                print(player_url)
                
                html_soup = getHtmlSoupFromUrl(player_url)
    
                # Create Player
                url_to_save = player_url.split("/")[-1].split(".htm")[0]
                info = info_scraper(url_to_save, html_soup)
                firebase.add_playerInfo(info)
            
    
    
